import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Dashboard.css';

const AdminDashboard = () => {
  const navigate = useNavigate();
  const [user, setUser] = useState(null);

  useEffect(() => {
    // Get user data from localStorage
    const userData = localStorage.getItem('user');
    if (!userData) {
      navigate('/login');
      return;
    }

    const parsedUser = JSON.parse(userData);
    if (parsedUser.userType !== 'admin') {
      navigate('/login');
      return;
    }

    setUser(parsedUser);
  }, [navigate]);

  if (!user) return null;

  return (
    <div className="dashboard-container">
      <div className="dashboard-header">
        <h1>Welcome, {user.name}!</h1>
        <p>Admin Dashboard</p>
      </div>

      <div className="dashboard-content">
        <div className="dashboard-card">
          <h3>Orders Management</h3>
          <p>View and manage all customer orders</p>
          <button className="dashboard-button">Manage Orders</button>
        </div>

        <div className="dashboard-card">
          <h3>User Management</h3>
          <p>Manage customer accounts</p>
          <button className="dashboard-button">Manage Users</button>
        </div>

        <div className="dashboard-card">
          <h3>Menu Management</h3>
          <p>Update meal plans and menus</p>
          <button className="dashboard-button">Manage Menu</button>
        </div>

        <div className="dashboard-card">
          <h3>Reports</h3>
          <p>View business analytics</p>
          <button className="dashboard-button">View Reports</button>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
